import { Link } from 'react-router-dom';

const ProjectsSection = () => {
  const projects = [
    {
      id: 1,
      title: 'App Emergencias',
      description: 'Aplicación móvil que permite a los ciudadanos reportar emergencias y verlas en un mapa en tiempo real. Los organismos de apoyo pueden responder a estas emergencias y seguir su ubicación.',
      tags: ['React Native', 'Firebase', 'Redux', 'Django'],
      image: '/placeholder-mobile.jpg',
      icon: 'images/logos/icon.png',
      type: 'mobile'
    },
    {
      id: 2,
      title: 'Ecomerce Anly',
      description: 'Una aplicación móvil de comercio electrónico desarrollada en Flutter, que permite a los usuarios explorar productos, agregarlos a favoritos y realizar compras de manera rápida y sencilla.',
      tags: ['Flutter', 'Dart', 'Firebase'],
      image: '/placeholder-mobile.jpg',
      icon: 'images/logos/logo.png',
      type: 'mobile'
    },
    // {
    //   id: 3,
    //   title: 'Red Social Móvil',
    //   description: 'Aplicación social con geolocalización y chat en tiempo real.',
    //   tags: ['Flutter', 'Firebase', 'WebSockets'],
    //   image: '/placeholder-web.jpg',
    //   type: 'mobile'
    // },
  ];

  return (
    <section className="py-20 px-4 bg-white">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl md:text-4xl font-bold text-center mb-16 text-gray-800">
          Mis <span className="text-red-800">Proyectos</span>
        </h2>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {projects.map((project) => (
            <div 
              key={project.id} 
              className="bg-white rounded-xl overflow-hidden shadow-lg hover:shadow-xl transition-shadow duration-300"
            >
              <div className="h-48 bg-gray-200 relative">
                <div className="absolute top-2 right-2 px-2 py-1 bg-white rounded-md text-xs font-medium shadow">
                  {project.type === 'mobile' ? '📱 Móvil' : '🌐 Web'}
                </div>
                <div className=" flex items-center justify-center pt-2">
                <img 
                  src={project.icon} 
                  alt={project.title} 
                  className="w-auto h-48 object-center"/>
</div>
              </div>
              <div className="p-6">
                <h3 className="text-xl font-bold mb-2 text-gray-800">{project.title}</h3>
                <p className="text-gray-600 mb-4">{project.description}</p>
                <div className="flex flex-wrap gap-2">
                  {project.tags.map((tag, index) => (
                    <span 
                      key={index} 
                      className="px-3 py-1 bg-gray-100 text-gray-700 text-sm rounded-full"
                    >
                      {tag}
                    </span>
                  ))}
                </div>
                <button className="mt-4 text-red-600 font-medium hover:text-red-800 transition-colors">
                  Ver detalles →
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default ProjectsSection;
